import React, { Component } from 'react'
import Sign from './Sign';

export default class Signs extends Component {

   makeSigns = (signs) =>{
     let signwad = null
    for (let i of signs){
      signwad += <div> I am a sign</div>
    }
    return signwad
  }


  render() {
   
    return (
      <div>
       { this.props.signs?this.makeSigns(this.props.signs.signs):'none'}
      </div>
    )
  }
}
